import { ParallaxBanner } from '../components/elements'

function Index() {

    return (
        <div>
            <ParallaxBanner image='/mainbg.png'></ParallaxBanner>
            <div className='content'>

            </div>
            <style jsx>{`
                .banner {
                    float: left;
                    width: 100%;
                    height: 600px;
                    overflow: hidden;
                    position: relative;
                }
                .content {
                    float: left;
                    width: 100%;
                    height: 400px;
                }
                .credit {
                    position: absolute;
                    left: 10px;
                    bottom: 10px;
                    z-index: 10;
                    color: white;
                }
                .main_bg {
                    position: absolute;
                    top: 50%;
                    left: 50%;
                    width: 100%;
                    transform: translate(-50%,-50%);
                }
            `}</style>
        </div>
    )
}

export default Index
